<script>
    var unittrans1='Cr';var unittrans2='Lac';function formatAmount(amount){var unit='';var CRORE=10000000;var LAC=100000;if(parseFloat(amount)>CRORE){amount=amount/CRORE;unit=unittrans1;}else if(amount>LAC){amount=amount/LAC;unit=unittrans2;}
return(amount.toLocaleString('en-IN',{style:'currency',currency:'INR',minimumFractionDigits:0})+' '+unit);}
function pmt(rate,per,nper,pv,fv){if(fv==0){return null;}
rate=rate/(per*100);if(rate==0){pmtValue=-(fv+pv)/nper;}else{var x=Math.pow(1+rate,nper);fv=fv+x*pv;pmtValue=-((rate*fv)/(-1+x));}
return pmtValue;}
$(document).ready(function(){$("#GoalSIPCalculatorForm").validate({ignore:[],debug:false,rules:{goal_sip_amount:{required:true,digits:true,min:1},goal_investment_duration:{required:true,digits:true,min:1,max:100},goal_rate_of_return:{required:true,number:true,min:1,max:100}},messages:{cktext:{required:"Please enter Description.",minlength:"Please enter 10 minimum characters."}},submitHandler:function(form){var goalAmount=parseFloat($('#goal_sip_amount').val());var rateOfReturn=parseFloat($('#goal_rate_of_return').val());var investmentDuration=parseFloat($('#goal_investment_duration').val());var per=12;var nper=per*investmentDuration;var pmtValue=pmt(rateOfReturn,per,nper,0,goalAmount)*-1;var investment=pmtValue*nper;$('#goal-sip-pmt').text(formatAmount(pmtValue));$('#goal-sip-investments').text(formatAmount(investment));$("html, body").animate({scrollTop:$("#slowDownPage").offset().top-220},1000);}});});
</script>

